BEGIN TRANSACTION;
DROP TABLE IF EXISTS "motherboard";
CREATE TABLE IF NOT EXISTS "motherboard" (
	"id"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"Name"	TEXT,
	"Manufacturer"	TEXT,
	"Socket / CPU"	TEXT,
	"Form Factor"	TEXT,
	"Chipset"	TEXT,
	"Memory Max"	TEXT,
	"Memory Type"	TEXT,
	"Memory Slots"	TEXT,
	"Color"	TEXT,
	"PCIe x16 Slots"	TEXT,
	"PCIe x8 Slots"	TEXT,
	"PCIe x4 Slots"	TEXT,
	"PCIe x1 Slots"	TEXT,
	"M.2 Slots"	TEXT,
	"SATA 6.0 Gb/s"	TEXT,
	"Onboard Ethernet"	TEXT,
	"USB 2.0 Headers"	TEXT,
	"USB 3.2 Gen 1 Headers"	TEXT,
	"USB 3.2 Gen 2 Headers"	TEXT,
	"USB 3.2 Gen 2x2 Headers"	TEXT,
	"Wireless Networking"	TEXT,
	"RAID Support"	TEXT,
	"Price"	TEXT,
	"Url"	TEXT
);
DROP TABLE IF EXISTS "psu";
CREATE TABLE IF NOT EXISTS "psu" (
	"id"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"Name"	TEXT,
	"Manufacturer"	TEXT,
	"Form Factor"	TEXT,
	"Efficiency Rating"	TEXT,
	"Wattage"	TEXT,
	"Length"	TEXT,
	"Modular"	TEXT,
	"Color"	TEXT,
	"Type"	TEXT,
	"Fanless"	TEXT,
	"ATX Connectors"	TEXT,
	"EPS Connectors"	TEXT,
	"PCIe 12-Pin Connectors"	TEXT,
	"PCIe 8-Pin Connectors"	TEXT,
	"PCIe 6+2-Pin Connectors"	TEXT,
	"PCIe 6-Pin Connectors"	TEXT,
	"SATA Connectors"	TEXT,
	"Molex 4-Pin Connectors"	TEXT,
	"Price"	TEXT,
	"Url"	TEXT
);
DROP TABLE IF EXISTS "storage";
CREATE TABLE IF NOT EXISTS "storage" (
	"id"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"Name"	TEXT,
	"Manufacturer"	TEXT,
	"Capacity"	TEXT,
	"Type"	TEXT,
	"Cache"	TEXT,
	"Form Factor"	TEXT,
	"Interface"	TEXT,
	"NVME"	TEXT,
	"Price"	TEXT,
	"Url"	TEXT
);
DROP TABLE IF EXISTS "memory";
CREATE TABLE IF NOT EXISTS "memory" (
	"id"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"Name"	TEXT,
	"Manufacturer"	TEXT,
	"Form Factor"	TEXT,
	"Modules"	TEXT,
	"Color"	TEXT,
	"CAS Latency"	TEXT,
	"Voltage"	TEXT,
	"ECC / Registered"	TEXT,
	"Heat Spreader"	TEXT,
	"Price"	TEXT,
	"Url"	TEXT
);
DROP TABLE IF EXISTS "gpu";
CREATE TABLE IF NOT EXISTS "gpu" (
	"id"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"Name"	TEXT,
	"Manufacturer"	TEXT,
	"Chipset"	TEXT,
	"Memory"	TEXT,
	"Memory Type"	TEXT,
	"Core Clock"	TEXT,
	"Boost Clock"	TEXT,
	"Effective Memory Clock"	TEXT,
	"Interface"	TEXT,
	"Color"	TEXT,
	"Length"	TEXT,
	"TDP"	TEXT,
	"Expansion Slot Width"	TEXT,
	"Cooling"	TEXT,
	"Price"	TEXT,
	"Url"	TEXT
);
DROP TABLE IF EXISTS "cpu cooler";
CREATE TABLE IF NOT EXISTS "cpu cooler" (
	"id"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"Name"	TEXT,
	"Manufacturer"	TEXT,
	"Fan RPM"	TEXT,
	"Noise Level"	TEXT,
	"Color"	TEXT,
	"Height"	TEXT,
	"Water Cooled"	TEXT,
	"Fanless"	TEXT,
	"Price"	TEXT,
	"Url"	TEXT
);
DROP TABLE IF EXISTS "case";
CREATE TABLE IF NOT EXISTS "case" (
	"id"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"Name"	TEXT,
	"Manufacturer"	TEXT,
	"Type"	TEXT,
	"Color"	TEXT,
	"Power Supply"	TEXT,
	"Side Panel Window"	TEXT,
	"Power Supply Shroud"	TEXT,
	"Motherboard Form Factor"	TEXT,
	"Maximum Video Card Length"	TEXT,
	"Volume"	TEXT,
	"Dimensions"	TEXT,
	"Price"	TEXT,
	"Url"	TEXT
);
DROP TABLE IF EXISTS "cpu";
CREATE TABLE IF NOT EXISTS "cpu" (
	"id"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"Name"	TEXT,
	"Manufacturer"	TEXT,
	"Core Count"	TEXT,
	"Performance Core Clock"	TEXT,
	"Performance Boost Clock"	TEXT,
	"TDP"	TEXT,
	"Integrated Graphics"	TEXT,
	"L3 Cache"	TEXT,
	"Simultaneous Multithreading"	TEXT,
	"Includes CPU Cooler"	TEXT,
	"Socket"	TEXT,
	"Price"	TEXT,
	"Url"	TEXT
);
COMMIT;
